import React, { useEffect } from "react";

const Cards = ({ movieTendance }) => {
  console.log(movieTendance.length);

  useEffect(() => {
    for (let i = 0; i < movieTendance.length; i++) {}
  }, []);
  return (
    <div>
      <h1>HELLO</h1>
      <h1>{movieTendance[0].title}</h1>
    </div>
  );
};

export default Cards;
